function wppfm_googleProductReviewFeedChanged(feedId,categoryChanged,nameChanged){var productReviewFileNameElement=jQuery("#wppfm-feed-file-name");if(nameChanged&&false===wppfm_validateFileName(productReviewFileNameElement.val())){productReviewFileNameElement.val("")}if(productReviewFileNameElement.val()&&jQuery("#wpprfm-publisher-name").val()){wpprfm_updateFeedFormAfterInputChanged(feedId);wpprfm_showCategoryAndAttributeMappingWrappers();wppfm_enableFeedActionButtons("google-product-review-feed")}else{wpprfm_hideCategoryAndAttributeMappingWrappers();disableFeedActionButtons("google-product-review-feed")}}function wpprfm_productReviewFeedSelected(){wpprfm_initializeProductReviewFeedForm(wppfm_getFileNameFromForm())}